import React from 'react'
function TodoItem(props) {
    // console.log(props.todo)

    return (
        <div>
            <input
                type='checkbox'
                className='checkBox'
                value={props.todo.checkbox}
            ></input>
            <input
                type='text'
                className='todoTitle'
                value={props.todo.title}
            ></input>
        </div>
    )
}
export default TodoItem
